// App.js
import React from 'react';
import {
  BrowserRouter,
  Route,
  Routes,
} from 'react-router-dom';
import Login from './Login';
import MainPage from './MainPage';

function App() {
  return (
    <Routes>
  <Route path="/main" element={<MainPage user={user} />} />
  <Route path="/" element={<Login />} />
</Routes>
  );
}

export default App;
